Expeditor WordPress Theme &#x2013; the ultimate WordPress Theme for cargo, logistics, warehouse, freight &amp; transportation company. 

Introducing this Logistics WordPress Template, the best clean WordPress Theme for transportation, trucking freight, and logistics companies and small freight business. It comes with wide range of homepage layouts that will fit any transportation industry size. 

With Nulled Expeditor WordPress Theme, we spent hours and hours researching the industry to be able to identify those elements needed to make a succcesfull web site in this industry. 

Expeditor WordPress Theme Features 
Modern, Clean, Minimal design; 
Based on Bootstrap 3 grid; 
Responsive and retina-ready layout; 
Preloader and amazing css animation; 
Cross-browser compatibility (IE9+); 
Valid HTML5 code; 
3 Color schemes; 
Visual Composer; 
Sliders Revolution; 
Sticky headers; 
Drop-down menu; 
Unlimited variants of footer; 
6 variants of header; 
Shortcode elements; 
Typography and Columns pages; 
Google fonts
